  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Lake Andes NWR
  outlines Refuge accomplishments from January through April of 1962. The report begins
  by summarizing the weather conditions, habitat conditions, water conditions, and
  food and cover during this period. Wildlife- including migratory birds, upland game
  birds, raptors, and fish- is also covered. The Refuge development and maintenance
  section discusses collections and receipts and prescribed burning. A progress report
  on field investigations and applied research is also provided. The public relations
  section of the report describes Refuge visitors, Refuge participation, and safety.
  Items of interest, N-R forms, and photographs are attached.\",\n\t\"owner_org\":
